import React from 'react'

function Header(props){

    const counter = 0

    function incrementCounter(){
        counter++
    }

    return (
        <>
            <h1> { props.title } </h1>
            <h1> Counter:{ counter }</h1>
            <button onClick={ incrementCounter }> Increment Counter </button>
        </>
    ) 
}

export default Header
